import React, { useEffect, useState } from "react";

import { Container } from "./styles";

function CartPage() {
  const [cartData, setCartData] = useState({ ProductData: [], CartData: [] });

  useEffect(() => {
    fetch("http://localhost:3000/cart/consultTheCart", {
      method: "get",
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
        Authorization: `Bearer ${localStorage.getItem("access_token")}`,
      },
    }).then(async (res) => {
      let data = await res.json();

      switch (res.status) {
        case 200:
          setCartData({ data: data.product });
          break;
      }
    });
  }, []);

  return (<Container>
    {cartData.data.map((t) => {
      return (<>{cartData.data.map()}</>)
    })}

  </Container>);
}

export default CartPage;
